import React, { useEffect, useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { postService } from './../../services/post.service';
import { Post } from '../../components/post/Post';
import axios from 'axios';
import { authHeader } from '../../helpers/auth-header';
import ImageList from '@material-ui/core/ImageList';
import ImageListItem from '@material-ui/core/ImageListItem';
const useStyles = makeStyles((theme) => ({

}));

export function ImgOfUser(props) {
    const idUser = props.idUser;
    const [img, setImg] = useState([])
    useEffect(() => {
        axios.get('http://localhost:8000/api/users/getImageOfUser/image', { headers: authHeader() })
            .then((result) => {
                setImg(result.data.restaurant);
            })
    }, []);
    return (
        <ImageList sx={{ width: 500, height: 450 }} cols={3} rowHeight={164}>
            {img.map((item) => (
                item.forEach(element => {
                    <ImageListItem>
                        <img
                            srcSet={`${element}?w=164&h=164&fit=crop&auto=format 1x,
            ${element}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
                            alt={element}
                            loading="lazy"
                        />
                    </ImageListItem>
                })

            ))}
        </ImageList>
    );
}
